import React from "react";
import "./movie-list.css";
import MovieItem from "./MovieItem.jsx";

function MovieList({ items, rankDisplayScope, onMovieSelect }) {
    return (
        <section className="movie-list">
            <button id="left" className="scroll-button"></button>
            <button id="right" className="scroll-button"></button>
            {items.map((item, key) => (
                <MovieItem
                    key={key}
                    index={key}
                    item={item}
                    isRankDisplay={(key < rankDisplayScope) || (rankDisplayScope === undefined)}
                    onMovieSelect={onMovieSelect}
                />
            ))}
        </section>
    );
}

export default MovieList;
